Removes the last element from the set and returns it, if any.
The last element is always the maximum element in the set.

# Examples

```
use std::collections::BTreeSet;

let mut set = BTreeSet::new();

set.insert(1);
while let Some(n) = set.pop_last() {
    assert_eq!(n, 1);
}
assert!(set.is_empty());
```
